import { initState } from '../initState';

export const add = (state = initState, action) =>{
const { type, payload } = action;
// console.log("payDATA====>", payload);
switch (type) {
  case 'ADD_ONE_USER_REQ':
    return { 
      payload
    };
    default:
      return state;
  }
}
